import React, { useState, Component } from "react";
import TextField from "@material-ui/core/TextField";
import Grid from "@material-ui/core/Grid";
import Button from "@material-ui/core/Button";
import Link from "@material-ui/core/Link";

export default class Recovered extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: null,
      email: null,
      password: null,

      bidprice: null,

      bloodgroup: null,
      city: null,
      longitude: props.longitude,
      latitude: props.latitude,
      phonenumber: null,
    };
  }
  componentDidMount() {
    window.navigator.geolocation.getCurrentPosition(
      (position) => {
        this.setState({
          lat: position.coords.latitude,
          lon: position.coords.longitude,
        });
      },
      (error) => {
        this.setState({
          err: error.message,
        });
      }
    );
  }
  changeHandler = (e) => {
    this.setState({ [e.target.name]: e.target.value });
  };
  handleChange1 = (e) => {
    this.setState({
      age: e.target.value,
    });
  };
  submitHandler = (e) => {
    e.preventDefault();
    console.log(this.state);
    const proxyurl = "https://cors-anywhere.herokuapp.com/";
    const url = "http://localhost:8080/covid/add";
    const response = fetch(url, {
      method: "POST",
      mode: "cors",
      cache: "no-cache",
      credentials: "same-origin",
      headers: {
        "Content-Type": "application/json",
      },
      redirect: "follow",
      referrerPolicy: "no-referrer",
      body: JSON.stringify(this.state),
    })
      .then((response) => response.text())
      .then((response) => console.log(response))
      .catch(() =>
        console.log("Canâ€™t access " + url + " response. Blocked by browser")
      );
  };

  render() {
    const paper = {
      marginTop: "64px",
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
    };
    const form = {
      width: "100%",
      marginTop: "24px",
    };
    const submit = {
      margin: "24px 0px 16px",
    };

    const formControl = {
      margin: "8px",
      minWidth: 120,
    };
    const selectEmpty = {
      marginTop: "16px",
    };
    const {
      name,
      email,
      password,
      bidprice,
      bloodgroup,
      city,
      phonenumber,
    } = this.state;

    return (
      <form style={form} noValidate onSubmit={this.submitHandler}>
        <Grid container spacing={2}>
          <Grid item xs={12} sm={6} lg={6}>
            <TextField
              autoComplete="name"
              name="name"
              variant="outlined"
              required
              fullWidth
              id="name"
              label="Name"
              autoFocus
              value={name}
              onChange={this.changeHandler}
            />
          </Grid>
          <Grid item xs={12} lg={6}>
            <TextField
              variant="outlined"
              required
              fullWidth
              id="bidprice"
              label="Rs Bid price"
              name="bidprice"
              autoComplete="bidprice"
              value={bidprice}
              onChange={this.changeHandler}
            />
          </Grid>

          <Grid item xs={12}>
            <TextField
              variant="outlined"
              required
              fullWidth
              id="email"
              label="Email Address"
              name="email"
              autoComplete="email"
              value={email}
              onChange={this.changeHandler}
            />
          </Grid>
          <Grid item xs={12}>
            <TextField
              variant="outlined"
              required
              fullWidth
              id="Phonenumber"
              label="Email Address"
              name="email"
              autoComplete="email"
              value={phonenumber}
              onChange={this.changeHandler}
            />
          </Grid>
          <Grid item xs={12}>
            <TextField
              variant="outlined"
              required
              fullWidth
              name="password"
              label="Password"
              type="password"
              id="password"
              autoComplete="current-password"
              value={name}
              onChange={this.changeHandler}
            />
          </Grid>

          <Grid item xs={12} sm={6} lg={6}>
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                name="city"
                label="city"
                type="city"
                id="city"
                autoComplete="city"
                value={city}
                onChange={this.changeHandler}
              />
            </Grid>
          </Grid>

          <Grid item xs={12} sm={6} lg={6}>
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                name="Bloodgroup"
                label="Bloodgroup"
                type="Bloodgroup"
                id="Bloodgroup"
                autoComplete="Bloodgroup"
                value={bloodgroup}
                onChange={this.changeHandler}
              />
            </Grid>
          </Grid>
          <Grid item xs={12}>
            <TextField
              variant="outlined"
              required
              fullWidth
              name="phonenumber"
              label="phonenumber"
              type="phonenumber"
              id="phonenumber"
              autoComplete="phonenumber"
              value={phonenumber}
              onChange={this.changeHandler}
            />
          </Grid>

          <Button
            type="submit"
            fullWidth
            variant="contained"
            color="primary"
            //   disabled={!validateForm()}
            style={submit}
          >
            Sign Up
          </Button>
          <Grid container justify="flex-end">
            <Grid item>
              <Link href="Signin" variant="body2">
                Already have an account? Sign in
              </Link>
            </Grid>
          </Grid>
        </Grid>
      </form>
    );
  }
}
